import MainPage from "./MainPage";
import Axios from 'axios'
import { useEffect, useState } from "react";

function Data() {
  const [gamoshvebisMult, SetGamoshvebisMult] = useState([]);
  const [damatebuliMult, SetDamatebuliMult] = useState([]);
  const [dasaqmebisMult, SetDasaqmebisMult] = useState([]);
  const [importisMult, SetImportisMult] = useState([]);
  const [dziritadiKapitaliMult, SetDziritadiKapitaliMult] = useState([]);
  const [shromisAnazgaureba, SetShromisAnazgaureba] = useState([]);







  useEffect(()=>{
    Axios.get('http://localhost:4000/GamoshvebisMult')
    .then((response) => {
      const data = response.data
      SetGamoshvebisMult(data)
    })
  }, [])

  useEffect(()=>{
    Axios.get('http://localhost:4000/DamatebuliMult')
    .then((response) => {
      const data = response.data
      SetDamatebuliMult(data)
    })
  }, [])

  useEffect(()=>{
    Axios.get('http://localhost:4000/DasaqmebisMult')
    .then((response) => {
      const data = response.data
      SetDasaqmebisMult(data)
    })
  }, [])

  useEffect(()=>{
    Axios.get('http://localhost:4000/ImportisMult')
    .then((response) => {
      const data = response.data
      SetImportisMult(data)
    })
  }, [])

  useEffect(()=>{
    Axios.get('http://localhost:4000/DziritadiKapitaliMult')
    .then((response) => {
      const data = response.data
      SetDziritadiKapitaliMult(data)
    })
  }, [])

  useEffect(()=>{
    Axios.get('http://localhost:4000/ShromisAnazgaureba')
    .then((response) => {
      const data = response.data
      SetShromisAnazgaureba(data)
    })
  }, [])



  return (
    <div>
      <MainPage />
      <p>
      </p>
    </div>
  );
}
export default Data;
